import React, { Component } from 'react';
import Menu from '../components/Menu';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron, Container, Form, FormGroup, Label, Input, Button } from 'reactstrap';

class Contact extends Component {
    render() {
        return (
            <>
                <Menu />
                <Jumbotron fluid className="head-contact">
                <style>{`
                .head-contact{
                padding-top:80px;
                padding-bottom:80px;
                background-color:#000;
                color:#fff;
                margin-bottom:0rem !important;
                }
                `}</style>
                    <Container>
                        <h1 className="display-4 text-center">Contato</h1>
                    </Container>
                </Jumbotron>

                <Jumbotron fluid className='contact'>
                <style>{`
                .contact{
                padding-top:80px;
                padding-bottom:80px;
                background-color:#fff;
                margin-bottom:0rem !important;
                }
                `}</style>
                    <Container>
                        <Form>
                            <Label for="name">Nome: </Label>
                            <Input type="text" name="name" id="name" />
                        </Form>
                        <Form>
                            <Label for="email">E-mail: </Label>
                            <Input type="text" name="emia" id="name" />
                        </Form>
                    </Container>
                </Jumbotron>
            </>
        )
    }
}

export default Contact
